import React from 'react'

const total = (props) => 
{
	return(
		<div className="total">
			<h1 className="total-title">{props.name}</h1>
			<div className="total-card"><div style={{color: 'black'}}>{props.value}</div></div>
		</div>
	)
};

export default total;
